import React, { useState } from "react";
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  Tooltip,
  Legend,
  ResponsiveContainer
} from "recharts";

const wasteData = {
  "SEA-JFK": [
    { quarter: "Q1", waste: 4500 },
    { quarter: "Q2", waste: 3900 },
    { quarter: "Q3", waste: 3400 },
    { quarter: "Q4", waste: 3100 }
  ],
  "ATL-PHX": [
    { quarter: "Q1", waste: 4200 },
    { quarter: "Q2", waste: 4100 },
    { quarter: "Q3", waste: 3800 },
    { quarter: "Q4", waste: 3500 }
  ]
};

const quarterInsights = {
  "SEA-JFK": {
    Q1: {
      untouched: ["Fruit Bowl", "Salad"],
      fullyEaten: ["Chicken Curry"],
      summary: "Fruit Bowl had high untouched rates ‚Äî consider replacing it with the eaten item from same flight route."
    },
    Q2: {
      untouched: ["Rice Bowl", "Paneer Wrap"],
      fullyEaten: ["Veg Lasagna"],
      summary: "Rice Bowl was mostly untouched, try offering a lighter option."
    },
    Q3: {
      untouched: ["Tofu Stir Fry"],
      fullyEaten: ["Chicken Sandwich"],
      summary: "Chicken Sandwich had best consumption rates in Q3."
    },
    Q4: {
      untouched: ["Salad", "Yogurt Cup"],
      fullyEaten: ["Pasta Salad"],
      InflightInsight: "Yogurt Cup underperformed which suggests people don't like dairy product, consider making it dairy free."
    }
  }
};

const RouteLineChart = () => {
  const [selectedRoute, setSelectedRoute] = useState("SEA-JFK");
  const [selectedQuarter, setSelectedQuarter] = useState(null);

  const handleChange = (e) => {
    setSelectedRoute(e.target.value);
    setSelectedQuarter(null);
  };

  const handleClick = (data) => {
    if (data && data.activeLabel) {
      setSelectedQuarter(data.activeLabel);
    }
  };

  return (
    <div>
      <h3 style={{ textAlign: "center" }}>Waste Trend - {selectedRoute}</h3>
      <div style={{ display: "flex", justifyContent: "flex-end", marginBottom: "10px" }}>
        <select
          value={selectedRoute}
          onChange={handleChange}
          style={{ padding: "5px", borderRadius: "5px" }}
        >
          {Object.keys(wasteData).map((route) => (
            <option key={route} value={route}>
              {route}
            </option>
          ))}
        </select>
      </div>
      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={wasteData[selectedRoute]}
          margin={{ top: 20, right: 30, left: 20, bottom: 50 }}
          onClick={handleClick}
        >
          <XAxis dataKey="quarter" label={{ value: "Quarter", position: "insideBottom", offset: -10 }} />
          <YAxis label={{ value: "Waste (g)", angle: -90, position: "insideLeft" }} />
          <Tooltip />
          <Legend verticalAlign="top" height={36} wrapperStyle={{ bottom: 0 }} />
          <Line
            type="monotone"
            dataKey="waste"
            stroke="#8884d8"
            strokeWidth={2}
            dot={{ r: 4 }}
            activeDot={{ r: 8 }}
          />
        </LineChart>
      </ResponsiveContainer>

      {selectedQuarter && (
        <div style={{ background: "#f9f9f9", padding: "1rem", marginTop: "1rem", borderRadius: "8px" }}>
          <h4>üìä Insight for {selectedQuarter} - {selectedRoute}</h4>
          <p><strong>üçΩÔ∏è Untouched Items:</strong> {quarterInsights[selectedRoute]?.[selectedQuarter]?.untouched.join(", ") || "N/A"}</p>
          <p><strong>‚úÖ Fully Eaten:</strong> {quarterInsights[selectedRoute]?.[selectedQuarter]?.fullyEaten.join(", ") || "N/A"}</p>
          <p><strong>üß† Summary:</strong> {quarterInsights[selectedRoute]?.[selectedQuarter]?.summary || "No insight available."}</p>
        </div>
      )}
    </div>
  );
};

export default RouteLineChart;
